const layout = [
  {i: 'a', x: 0, y: 0, w: 1, h: 2, static: true},
     {i: 'b', x: 1, y: 0, w: 3, h: 2, minW: 2, maxW: 4},
     {i: 'c', x: 4, y: 0, w: 1, h: 2}
];

ReactDOM.render(
  <React.StrictMode>
    <div class='grid-container'>
      <Sidebar class='grid-sidebar'/>
      <div class='header'/>
      <div class = 'content'/>
    </div>

  <BalanceGroup/>
</React.StrictMode>, document.getElementById('root'));

